import React, { useState } from 'react';
import '../../App.css';
import { Button } from '../Button';
import './SignUp.css'
export default function SignUp() {
  const [input, setInput] = useState("");
  const inputHandler = (e) => {
    setInput(e.target.value);
  };

  return (
    <div className='sign-up-container'>
      <section className='sign-up-subscription'>
        <p className='sign-up-subscription-heading'>
          Join the waitlist for Fitless
        </p>
        <p className='sign-up-subscription-text'>
          You can unsubscribe at any time.
        </p>
        <div className='input-areas'>
          <form>
            <input
              className='sign-up-input'
              name='email'
              type='email'
              placeholder='Your Email'
              onChange={inputHandler}
            />
            <select className="sign-up-drop-down">
              <option selected value="user">User</option>
              <option value="trainer">Trainer</option>
              <option value="fc">Fitness Center</option>
            </select>
            <Button buttonStyle='btn--primary--rev'>Sign Up</Button>
          </form>
        </div>
      </section>
    </div>
  );
}
